import React from "react";

function HelloDiv() {
  return (
    <div>
      <h1>Hey, I'm that dude</h1>
      <ul>
        <li>I like this</li>
        <li>I like that</li>
        <li>I also like that</li>
      </ul>
    </div>
  );
}

export default HelloDiv;
